import styled from "styled-components";

export const MainContainer = styled.div`
  max-width: 1200px;
  margin: auto;
`;
export const Logo = styled.div`
  > span:first-child {
    display: inline-block;
    height: 15px;
    width: 15px;
    background-color: black;
    border-radius: 50px;
  }
  > span:nth-child(2) {
    display: inline-block;
    height: 15px;
    width: 2px;
    background-color: black;
    margin: 0 15px;
  }
`;
